                  className={styles.sensorRadio}
                >
                  <div>
                    <FormControlLabel
                      labelPlacement="start"
                      value="intermittent"
                      control={<Radio />}
                      label="Intermittent Monitoring"
                    />
                  </div>
                  <FormControlLabel
                    labelPlacement="start"
                    value="continuous"
                    control={<Radio />}
                    label="Continuous Monitoring"
                  />
                </RadioGroup>
                <div className={styles.parameters}>
